import './App.css';
import Header from './components/header/Header';
import image from './images/main-head.jpg';
import Navbar from './components/navbar/Navbar';
import UpcomingMatches from './components/match/UpcomingMatches';
import MatchMedium from './components/match/MatchMedium';

import teamHome from '../../images/club-logos/167.jpg'
import teamAway from '../../images/club-logos/4897.jpg'


function App() {
  return (
    <div>
    <Navbar />
    <Header
      src={image}
      text="SPR BOR Oborniki Śląskie"
      />
    <UpcomingMatches />
    <MatchMedium 
      date="25/07/2002"
      time="18:00"
      teamHome = "SPR BOR"
      teamAway = "SPR GOKIS"
      teamHomeSrc={teamHome}
      teamAwaySrc={teamAway}
      />
    </div>
  );
}

export default App;
